import React from "react";
import "./Banner.css";
import BannerImg from "../assets/banner.png";
export default function Banner() {
  return (
    <div className="banner">
      <div className="bannerTextContain">
        <p className="proText">Pro.Beyond</p>
        <h1 className="BannerHeading">Iphone 14 Pro</h1>
        <p className="subHeading">
          Created to change everything for the better. For everyone
        </p>
        <a className="shopNowBtn">Shop Now</a>
      </div>
      <div className="phoneImgContain">
        <img className="iphoneImg" src={BannerImg} />
      </div>
    </div>
  );
}
